Кабинет клиента – это простое и удобное мобильное приложение для заказа товаров и онлайн-записи на услуги у различных фирм и компаний. Для подключения к нужной компании используйте QR-код или специальный код компании.

С помощью мобильного приложения "Кабинет клиента" вы сможете:
• Заказывать товары;
• Просматривать историю заказов;
• Оплачивать заказы онлайн;
• Записываться на услуги;
• Просматривать детали предстоящих и прошедших записей, повторять и отменять запись;
• Ознакомиться с детальной информацией о компании;
• Устанавливать напоминания о предстоящих записях. 

Приложение "Кабинет клиента" разработано на мобильной платформе "1С:Предприятие 8".

Для оперативного решения проблем, возникающих при работе с мобильным приложением пишите на v8@1c.ru
